import { Routes, Route } from "react-router-dom"



const AppRoutes = () => {

    return (
        <Routes>
            <Route path="/" element={<p>The Phone Cave</p>} />
            <Route path="/galeria" element={<p>/galeria</p>} />
            <Route path="/detalles/:phone_id" element={<p>/detalles/:phone_id</p>} />
        </Routes>
    )
}

export default AppRoutes
